    body {
        margin:10px;
    }
    h1 {
        font-size:68pqt;
        font-weight:bold;
        text-align:right;
        letter-spacing:-8px;
        color:#f0f0f0;
        margin:-32px 0;
    }
    p {
        margin:0;
        color:#666;
        font-size:16pt;
    }
`}</style>;
